export const Todo = (
    {
        id,
        todo,
        deadline,
        is_done,
        user_id,
        created_at,
        updated_at,
        getData,
    }
) => {



    return (
        <li key={id} id={id}>
            <input type="checkbox" checked={is_done} />
            <p>
                {deadline} {todo} by {user_id} at {created_at} and {updated_at}
            </p>
        </li>
    );
};
